原文把 rootRetain 方法拆散了，方便解析，下面是 rootRetain 的全部实现，易于查看整个流程： id objc_object::rootRetain(bool tryRetain, bool handleOverflow)
{ if (isTaggedPointer()) return (id)this; bool sideTableLocked = false; bool transcribeToSideTable = false; isa_t oldisa; isa_t newisa; do { transcribeToSideTable = false; // 加载 isa 的值 oldisa = LoadExclusive(&isa.bits); newisa = oldisa; // 如果不支持 nonpointer ，即不用 isa 本身来存储引用计数，则直接走 SideTable 流程 if (slowpath(!newisa.nonpointer)) { ClearExclusive(&isa.bits); if (!tryRetain && sideTableLocked) sidetable_unlock(); if (tryRetain) return sidetable_tryRetain() ? (id)this : nil; else return sidetable_retain(); } // 如果 isa 在 dealloc 流程中，则直接返回 nil if (slowpath(tryRetain && newisa.deallocating)) { ClearExclusive(&isa.bits); if (!tryRetain && sideTableLocked) sidetable_unlock(); return nil; } // uintptr_t carry; // 将 isa 的值加 1 newisa.bits = addc(newisa.bits, RC_ONE, 0, &carry); // 引用计数超出 extra_rc 限制，改用 SideTable if (slowpath(carry)) { // handleOverflow 为 false if (!handleOverflow) { ClearExclusive(&isa.bits); // handleOverflow 改为 true ，从走 retain return rootRetain_overflow(tryRetain); } // 把 isa 的 extra_rc 恢复为一半，和做好准备把另外一半拷贝到 SideTable if (!tryRetain && !sideTableLocked) sidetable_lock(); sideTableLocked = true; transcribeToSideTable = true; // 把 extra_rc 恢复为一半 newisa.extra_rc = RC_HALF; newisa.has_sidetable_rc = true; } // StoreExclusive 更新 isa 的值 } while (slowpath(!StoreExclusive(&isa.bits, oldisa.bits, newisa.bits))); // 如果说 isa 有溢出， 把一半的引用计数拷贝到 SideTable if (slowpath(transcribeToSideTable)) { sidetable_addExtraRC_nolock(RC_HALF); } if (slowpath(!tryRetain && sideTableLocked)) sidetable_unlock(); return (id)this;
} bool objc_object::sidetable_addExtraRC_nolock(size_t delta_rc) { SideTable& table = SideTables()[this]; size_t& refcntStorage = table.refcnts[this]; size_t oldRefcnt = refcntStorage; // 溢出，直接返回 true if (oldRefcnt & SIDE_TABLE_RC_PINNED) return true; uintptr_t carry; size_t newRefcnt = addc(oldRefcnt, delta_rc << SIDE_TABLE_RC_SHIFT, 0, &carry); if (carry) { // 如果有溢出，则将 refcntStorage 设为 SIDE_TABLE_RC_PINNED refcntStorage = SIDE_TABLE_RC_PINNED | (oldRefcnt & SIDE_TABLE_FLAG_MASK); return true; } else { // 没有溢出，新值赋给 refcntStorage refcntStorage = newRefcnt; return false; }
} 可以看到 retain 时会动态结合 isa 的 extra_rc 和 SideTable 来存储引用计数： extra_rc 不需要查找，速度会更快，所以优先使用 extra_rc 管理引用计数； 如果 extra_rc 溢出，则把 extra_rc 的一半拷贝到 SideTable 中， SideTable 并没有直接参与引用计数管理； 如果引用计数为 1 ， extra_rc 为 0 ，保存的是额外的引用计数。

