bool objc_object::rootRelease(bool performDealloc, bool handleUnderflow)
{ if (isTaggedPointer()) return false; bool sideTableLocked = false; isa_t oldisa; isa_t newisa; retry: do { oldisa = LoadExclusive(&isa.bits); newisa = oldisa; // 如果不支持 nonpointer ，即不用 isa 本身来存储引用计数，则直接走 SideTable 流程 if (slowpath(!newisa.nonpointer)) { ClearExclusive(&isa.bits); if (sideTableLocked) sidetable_unlock(); return sidetable_release(performDealloc); } uintptr_t carry; // extra_rc 减 1 newisa.bits = subc(newisa.bits, RC_ONE, 0, &carry); // 如果不够，则走 SideTable 流程 if (slowpath(carry)) { goto underflow; } // 调用 StoreReleaseExclusive 方法保存新的引用计数 } while (slowpath(!StoreReleaseExclusive(&isa.bits, oldisa.bits, newisa.bits))); if (slowpath(sideTableLocked)) sidetable_unlock(); return false; underflow: newisa = oldisa; // 判断是否有使用 SideTable if (slowpath(newisa.has_sidetable_rc)) { // 将 handleUnderflow 设为 true ，递归调用 if (!handleUnderflow) { ClearExclusive(&isa.bits); return rootRelease_underflow(performDealloc); } if (!sideTableLocked) { ClearExclusive(&isa.bits); sidetable_lock(); sideTableLocked = true; goto retry; } // 从 SideTable 中获取 extra_rc 最大值的一半，即 RC_HALF size_t borrowed = sidetable_subExtraRC_nolock(RC_HALF); if (borrowed > 0) { // 将一半引用计数放到 extra_rc 中 newisa.extra_rc = borrowed - 1; bool stored = StoreReleaseExclusive(&isa.bits, oldisa.bits, newisa.bits); if (!stored) { // 如果存放到 extra_rc 中失败，重新加载 isa 和尝试存放 isa_t oldisa2 = LoadExclusive(&isa.bits); isa_t newisa2 = oldisa2; if (newisa2.nonpointer) { uintptr_t overflow; newisa2.bits = addc(newisa2.bits, RC_ONE * (borrowed-1), 0, &overflow); if (!overflow) { stored = StoreReleaseExclusive(&isa.bits, oldisa2.bits, newisa2.bits); } } } // 如果还是失败，则把引用计数放回 SideTable if (!stored) { sidetable_addExtraRC_nolock(borrowed); goto retry; } sidetable_unlock(); return false; } else { // SideTable 为空，执行 dealloc ，不需要执行任何处理 } } if (slowpath(newisa.deallocating)) { // 对象正在释放 ClearExclusive(&isa.bits); if (sideTableLocked) sidetable_unlock(); return overrelease_error(); } // 设置 deallocating 标志位 newisa.deallocating = true; if (!StoreExclusive(&isa.bits, oldisa.bits, newisa.bits)) goto retry; if (slowpath(sideTableLocked)) sidetable_unlock(); __sync_synchronize(); if (performDealloc) { // 通过 objc_msgSend 直接执行 dealloc ((void(*)(objc_object *, SEL))objc_msgSend)(this, SEL_dealloc); } return true;
} release 的处理流程和 retain 类似，多了一个 dealloc 的执行流程。

