mikeash.com: Friday Q&A 2015-09-04: Let's Build dispatch_queue Mikeash 自己实现的一个简易版的 dispatch_queue ，源码： GitHub - mikeash/MADispatchQueue: A spiritual reimplementation of the basics of dispatch_queue, for educational purposes 支持以下功能： 串行或者并发； 同步和异步派发； 底层使用同一个线程池。 与 GCD 提供的 C API 不同，接口层通过 Objective-C 实现。 MADispatchQueue 提供了四个接口： @interface MADispatchQueue : NSObject
// 全局队列， GCD 支持根据不同优先级获取不同的队列， MADispatchQueue 没有实现这个功能 + (MADispatchQueue *)globalQueue; // 初始化方法，通过 serial 来定义是串行还是并发
- (id)initSerial: (BOOL)serial; // 执行异步 block
- (void)dispatchAsync: (dispatch_block_t)block; // 执行同步 block
- (void)dispatchSync: (dispatch_block_t)block; @end 线程池能力由 MAThreadPool 提供，只提供了一个能力：执行所提交的任务，所以对外只提供了以下接口： @interface MAThreadPool : NSObject - (void)addBlock: (dispatch_block_t)block; @end @implementation MAThreadPool { // 使用 NSCondition 来作为锁，可以通过 signal 和 wait 进行通信 NSCondition *_lock; // 当前所开启的线程 NSUInteger _threadCount; // 执行任务中的线程 NSUInteger _activeThreadCount; // 最大线程数 NSUInteger _threadCountLimit; // 需要执行的 block NSMutableArray *_blocks;
} - (id)init { if((self = [super init])) { _lock = [[NSCondition alloc] init]; _blocks = [[NSMutableArray alloc] init]; _threadCountLimit = 128; } return self;
} - (void)addBlock: (dispatch_block_t)block { // 加锁保证线程安全 [_lock lock]; // 添加 block 到 blocks 数组中 [_blocks addObject: block]; // 判断当前空闲线程是否可以处理完所有待处理的 blocks // 如果说 blocks 数量大于空闲线程数且当前线程数小于最大线程数，则可以开启新线程 NSUInteger idleThreads = _threadCount - _activeThreadCount; if([_blocks count] > idleThreads && _threadCount < _threadCountLimit) { [NSThread detachNewThreadSelector: @selector(workerThreadLoop:) toTarget: self withObject: nil]; _threadCount++; } // signal 执行任务 [_lock signal]; [_lock unlock];
} - (void)workerThreadLoop: (id)ignore { [_lock lock]; // 线程保活，实现类似 RunLoop 的流程 while(1) { while([_blocks count] == 0) { // wait 等待任务派发 [_lock wait]; } // 获取第一个任务 dispatch_block_t block = [_blocks firstObject]; [_blocks removeObjectAtIndex: 0]; _activeThreadCount++; [_lock unlock]; block(); [_lock lock]; _activeThreadCount--; }
} @end MADispatchQueue 的实现： @implementation MADispatchQueue { NSLock *_lock; NSMutableArray *_pendingBlocks; BOOL _serial; // 是否在执行任务 BOOL _serialRunning;
} static MADispatchQueue *gGlobalQueue;
static MAThreadPool *gThreadPool; // 借用 initialize 机制初始化 gGlobalQueue 和 gThreadPool // 因为 dispatch_once 是 GCD 提供的能力，作者不想通过 GCD API 来实现 GCD 的功能，所以改用通过 initialize 来实现
+ (void)initialize { if(self == [MADispatchQueue class]) { gGlobalQueue = [[MADispatchQueue alloc] initSerial: NO]; gThreadPool = [[MAThreadPool alloc] init]; }
} + (MADispatchQueue *)globalQueue { return gGlobalQueue;
} - (id)initSerial: (BOOL)serial { if ((self = [super init])) { _lock = [[NSLock alloc] init]; _pendingBlocks = [[NSMutableArray alloc] init]; _serial = serial; } return self;
} // 异步派发
- (void)dispatchAsync: (dispatch_block_t)block { [_lock lock]; [_pendingBlocks addObject: block]; // 如果是串行，且没有在执行 block if(_serial && !_serialRunning) { _serialRunning = YES; [self dispatchOneBlock]; } else if (!_serial) { // 并发队列，直接执行 block 即可 [self dispatchOneBlock]; } // 如果是串行且在执行 block 中，则不需要做任何处理， dispatchOneBlock 执行完后会自动检查是否还需要处理 blocks [_lock unlock];
} // 同步派发，基于 async 进行任务派发，通过 condition 强行同步😂
- (void)dispatchSync: (dispatch_block_t)block { NSCondition *condition = [[NSCondition alloc] init]; __block BOOL done = NO; [self dispatchAsync: ^{ block(); [condition lock]; done = YES; [condition signal]; [condition unlock]; }]; [condition lock]; while (!done) { [condition wait]; } [condition unlock];
} // 负责处理 pendingBlocks 的任务
- (void)dispatchOneBlock { [gThreadPool addBlock: ^{ // 加 lock 保证线程安全 [_lock lock]; dispatch_block_t block = [_pendingBlocks firstObject]; [_pendingBlocks removeObjectAtIndex: 0]; [_lock unlock]; block(); // 如果是串行，则判断是否还有处理中的 blocks if(_serial) { [_lock lock]; if([_pendingBlocks count] > 0) { [self dispatchOneBlock]; } else { // 结束任务执行 _serialRunning = NO; } [_lock unlock]; } }];
} @end 作者的总结： 全局线程池可以通过一个工作队列 （ Queue ）和自动管理线程来实现，使用共享的全局线程池，可以提供基本的调度队列 API ，支持基本的串行/并发和同步/异步调度，虽然说缺少了不少 GCD 的功能，但是可以很好地了解 GCD 的运作方式。

