mikeash.com: Friday Q&A 2014-06-06: Secrets of dispatch_once static dispatch_once_t predicate; dispatch_once(&predicate, ^{ // some one-time task
}); dispatch_once 只需要提供两个参数： predicate ，一个 token ，用于保证执行一次； block ，需要执行的具体操作； 在单线程中， 我们使用一个 if 就可以保证方法只执行一次。但是在多线程中，就需要通过 dispatch_once 来保证 block 只执行一次，且其它线程需要等待 dispatch_once 执行完成。自己实现对应的版本并不难，但是 dispatch_once 的速度极快，这点比较难实现。 单线程版本： void SimpleOnce(dispatch_once_t *predicate, dispatch_block_t block) { if(!*predicate) { block(); *predicate = 1; }
} dispatch_once_t 只是一个 long 的 typedef ，初始化为 0 ， block 执行完毕后设置为 1 以保证不会多次执行。但是在多线程时，可能会同时进入到 if 条件判断中，导致多次执行。 关于 dispatch_once 的性能部分，有下面三个场景需要考虑清楚： 首次调用 dispatch_once 的调用者会直接执行 block ； 在首次调用到 block 完成执行之间调用，需要等待 block 完成； 在 block 完成后调用，无需等待，可以直接继续后续流程； 1 和 2 都不是非常重要，1 只会出现一次，而 2 基本上很少出现。 最重要的是第3点，在程序中会有可能出现成千上万次，每次我们都需要保证 dispatch_once 只执行一次。可以使用 SimpleOnce 作为我们性能测试的黄金准则。

