深入理解RunLoop 这篇文章写得非常好，推荐反复阅读。 RunLoop 相关类和关系图： 一个 RunLoop 包含若干个 Mode，每个 Mode 又包含若干个 Source/Timer/Observer 。每次调用 RunLoop 的主函数时，只能指定其中一个 Mode，这个Mode被称作 CurrentMode 。如果需要切换 Mode ，只能退出 Loop，再重新指定一个 Mode 进入。这样做主要是为了分隔开不同组的 Source/Timer/Observer ，让其互不影响。 RunLoop 通知 Observers 的流程： RunLoop 的应用： AutoreleasePool ，苹果在主线程的 RunLoop 里注册了两个 Observer ，其回调都是 _wrapRunLoopWithAutoreleasePoolHandler() 。第一个 Observer 监听 Entry ，调用 _objc_autoreleasePoolPush() 创建 AutoreleasePool ， order 是 -2147483647 ，优先级最高，这样可以在其它回调之前就进行创建 AutoreleasePool 。第二个 Observer 监听了 BeforeWaiting 和 Exit ， BeforeWaiting 时调用 _objc_autoreleasePoolPop() 来退出旧的 AutoreleasePool ，然后调用 _objc_autoreleasePoolPush() 来创建新的 AutoreleasePool ，给下一轮使用。而在 Exit 时也会调用 _objc_autoreleasePoolPop() 来退出 AutoreleasePool ， Observer 的优先级是 2147483647 ，优先级最低，确保在最后进行处理； 事件响应，注册了一个基于 mach port 的 Source1 来接收系统事件，流程：IOKit.framework 生成 IOHIDEvent 事件 → SpringBoard 接收 → mach port 转发给 App → 触发 Source1 回调 → _UIApplicationHandleEventQueue() 进行分发。包括点击事件/屏幕旋转等； 界面更新，在操作 UI 时，比如更新 frame ，对 UIView/CALayer 视图相关的属性进行操作，或者手动调用 setNeedsLayout/setNeedsDisplay 方法后，系统会将记录这个 UIView/CALayer ，然后通过监听 BeforeWaiting 和 Exit 事件，执行 _ZN2CA11Transaction17observer_callbackEP19__CFRunLoopObservermPv() ，在这里面对所有待处理的 UIView/CALayer 进行绘制，更新界面； NSTimer 回调， NSTimer 其实是 CFRunLoopTimerRef 的桥接， NSTimer 注册到 RunLoop 后， RunLoop 会持有这个 NSTimer ，直到 invalidate 或者方法执行完毕。所以如果 NSTimer 的 repeat 为 YES 及和强引用 target 时，会导致 NSTimer 和 target 无法释放。且如果 RunLoop 切换了 mode ，而对应的 NSTimer 没有添加到 commonMode ，那么 NSTimer 就不会执行； NSObject 调用 performSelector:afterDelay: 后，内部会创建一个 Timer 添加到当前线程的 RunLoop 中，如果说当前线程没有 RunLoop ，那么这个方法就会失效。 performSelector:onThread: 则可以指定对应的线程； 通过 GCD 的 dispatch_async(dispatch_get_main_queue(), block) 切换到主队列执行 block 时， libDispatch 会向主线程 RunLoop 发送消息，唤醒 RunLoop ，然后从消息中获取和执行 block 。 关于线程保活： 线程在执行完任务后就会退出和销毁，通过创建 RunLoop 和添加 Timer/Observer/Source 到 RunLoop 中，使得线程不退出，这样可以在该线程中接收和处理消息。比较经典的是 AFNetworking 2.0 中的做法： + (NSThread *)networkRequestThread { static NSThread *_networkRequestThread = nil; static dispatch_once_t oncePredicate; dispatch_once(&oncePredicate, ^{ _networkRequestThread = [[NSThread alloc] initWithTarget:self selector:@selector(networkRequestThreadEntryPoint:) object:nil]; [_networkRequestThread start]; }); return _networkRequestThread;
