Apple Developer Documentation 手指在屏幕上移动时可以由 UIPanGestureRecognizer 进行处理，针对屏幕边缘的移动手势，可以交给 UIPanGestureRecognizer 的子类 UIScreenEdgePanGestureRecognizer 来处理。 当手指的移动距离满足要求时， UIPanGestureRecognizer 就会进入 UIGestureRecognizerStateBegan 状态； 当初始化完成后，随之而来的改变会使得 UIPanGestureRecognizer 进入 UIGestureRecognizerStateChanged 状态； 当手指离开屏幕后，就会变为 UIGestureRecognizerStateEnded 状态。 为了简化追踪处理， UIPanGestureRecognizer 提供了 translationInView: 方法来获取用户手指距离原始位置的距离。苹果提供的示例： var initialCenter = CGPoint() // The initial center point of the view.
@IBAction func panPiece(_ gestureRecognizer : UIPanGestureRecognizer) { guard gestureRecognizer.view != nil else {return} let piece = gestureRecognizer.view! // Get the changes in the X and Y directions relative to // the superview's coordinate space. let translation = gestureRecognizer.translation(in: piece.superview) if gestureRecognizer.state == .began { // Save the view's original position. self.initialCenter = piece.center } // Update the position for the .began, .changed, and .ended states if gestureRecognizer.state != .cancelled { // Add the X and Y translation to the view's original position. let newCenter = CGPoint(x: initialCenter.x + translation.x, y: initialCenter.y + translation.y) piece.center = newCenter } else { // On cancellation, return the piece to its original location. piece.center = initialCenter }
}

