iOS | 事件传递及响应链 iOS 中处理响应事件的是 UIResponder ，只要是 UIResponder 的子类都可以进行处理。在触摸事件发生后， UIApplication 会调用 sendEvennt(_ event: UIEvent) 方法来将 UIEvent 传递给 UIWindow ，而 UIWindow 则会通过 hitTest 和 point(inside point: CGPoint, with event: UIEvent?) -> Bool 方法来查找第一响应者。 检查自身是否可接收事件： view.isUserInteractionEnabled 为 true ； view.alpha > 0.01 ； view.isHidden = false 。 判断左边是否在自身内部，通过 point(inside point: CGPoint, with event: UIEvent?) -> Bool ，可以通过重写这个方法来扩大点击范围。 类似的代码实现： class HitTestExampleView: UIView { override func hitTest(_ point: CGPoint, with event: UIEvent?) -> UIView? { if !isUserInteractionEnabled || isHidden || alpha <= 0.01 { return nil // 此处指视图无法接受事件 } if self.point(inside: point, with: event) { // 判断触摸点是否在自身内部 for subview in subviews.reversed() { // 按 FILO 遍历子视图 let convertedPoint = subview.convert(point, from: self) let resultView = subview.hitTest(convertedPoint, with: event) // ⬆️这句是判断触摸点是否在子视图内部，在就返回视图，不在就返回nil if resultView != nil { return resultView } } return self // 此处指该视图的所有子视图都不符合要求，而触摸点又在该视图自身内部 } return nil // 此处指触摸点是否不在该视图内部 }
} 当找到对应的第一响应者，响应链也随之确认了： 当确认响应链后，就会调用 UIResponder 中对应的方法： class TouchesExampleView: UIView { override func touchesBegan(_ touches: Set<UITouch>, with event: UIEvent?) { print("Touches Began on " + colorBlock) super.touchesBegan(touches, with: event) } override func touchesMoved(_ touches: Set<UITouch>, with event: UIEvent?) { print("Touches Moved on " + colorBlock) super.touchesMoved(touches, with: event) } override func touchesEnded(_ touches: Set<UITouch>, with event: UIEvent?) { print("Touches Ended on " + colorBlock) super.touchesEnded(touches, with: event) }
} 如果是 UIControl 或者其子类，则会拦截掉其响应链的事件传递，不会向下调用 UIResponder 的相关方法。 UIScrollView 也是相同的工作机制。 iOS | 响应链及手势识别 在 UIResponder 的 touches 系列方法中的 UITouch 包含了收集到 的 UIGestureRecognizers 。在触发 touches 方法的过程中，也会判断 UITouch 是否符号收集到的手势； 当成功识别手势时，第一响应者会收到 touchesCancelled 方法，且不会再收到来自该 UITouch 的 touches 事件，同时该 UITouch 关联的其它手势也会收到 touchesCancelled 。使得可以独占该 UITouch ； 手势未识别成功时， UIGestureRecognizer 的 state 为 .possible ，表示可能有机会识别成功。

