之前做过一个需求是用户在一定时间内没有点击屏幕就进行一些处理，我们可以对响应事件的顶层 UIApplication 进行操作，hook 它的 sendEvent: 事件，在用户停止点击时开始计时，记录用户没有点击的时间，进行一些操作。有几个需要注意的地方： sendEvent 不仅仅是处理点击事件，所以需要判断下 allTouches.count 是否为 0 ，如果为 0 则表示不是点击事件； 如果 touch.phase == UITouchPhaseBegan 表示用户点击屏幕，停止计时； 如果 phase == UITouchPhaseEnded ，则表示有手指离开屏幕，因为有可能是多指同时点击，所以这里记录下 countOfEnded ，如果 touches.count == countOfEnded ，表示所有手指都离开屏幕，可以开始计时； - (void)dt_sendEvent:(UIEvent *)event
{ [self dt_sendEvent:event]; if (event.allTouches.count == 0) { return; } NSArray <UITouch *> *touches = [event.allTouches allObjects]; NSUInteger countOfEnded = 0; for (UITouch *touch in touches) { UITouchPhase phase = touch.phase; if (phase == UITouchPhaseBegan) { // 开始点击，停止计时 // stopTimer return; } else if (phase == UITouchPhaseEnded) { countOfEnded += 1; } } // 所有点击事件都结束，开始计时 if (touches.count == countOfEnded) { // startTimer }
}

