iOS Responder Chain: UIResponder, UIEvent, UIControl and uses 这篇文章虽然也是讲了下 UIResponder ， UIEvent 和 UIControl ，但是后面有几个非常有趣的用法。 final class BlinkableView: UIView { override var canBecomeFirstResponder: Bool { return true } func select() { becomeFirstResponder() } @objc func performBlinkAction() { //Blinking animation }
} UIApplication.shared.sendAction(#selector(BlinkableView.performBlinkAction), to: nil, from: nil, for: nil)
//Will precisely blink the last BlinkableView that had select() called. BlinkableView 的 canBecomeFirstResponder 返回 true ，调用 select 时 becomeFirstResponder() 。然后说下具体用法，比如说现在我们想让当前的 BlinkableView 执行 performBlinkAction() 方法，其它的 BlinkableView 都不执行，可以通过 UIApplication.shared.sendAction(#selector(BlinkableView.performBlinkAction), to: nil, from: nil, for: nil) 方法来达到目的，当响应链找到第一个 BlinkableView (firstResponder) 时就会停止。 final class PushScreenEvent: UIEvent { let viewController: CoordenableViewController override var type: UIEvent.EventType { return .touches } init(viewController: CoordenableViewController) { self.viewController = viewController }
} final class Coordinator: UIResponder { weak var viewController: CoordenableViewController? override var next: UIResponder? { return viewController?.originalNextResponder } @objc func pushNewScreen(sender: Any?, event: PushScreenEvent) { let new = event.viewController viewController?.navigationController?.pushViewController(new, animated: true) }
} class CoordenableViewController: UIViewController { override var canBecomeFirstResponder: Bool { return true } private(set) var coordinator: Coordinator? private(set) var originalNextResponder: UIResponder? override var next: UIResponder? { return coordinator ?? super.next } override func viewDidAppear(_ animated: Bool) { //Fill info at viewDidAppear to make sure UIKit //has configured this view's next responder. super.viewDidAppear(animated) guard coordinator == nil else { return } originalNextResponder = next coordinator = Coordinator() coordinator?.viewController = self }
} final class MyViewController: CoordenableViewController { //...
} //From anywhere in the app: let newVC = NewViewController()
UIApplication.shared.push(vc: newVC) // 源代码漏了这段，给补上
extension UIApplication { func push(vc: CoordenableViewController) { UIApplication.shared.sendAction(#selector(Coordinator.pushNewScreen(sender:event:)), to: nil, from: nil, for: PushScreenEvent(viewController: CoordenableViewController)) }
} 调整后的响应链如下： // MyView -> MyViewController -> Coordinator -> UIWindow -> UIApplication -> AppDelegate 当通过 UIApplication 发送 action 时，通过响应链查找可以找到 Coordinator ， Coordinator 通过 PushScreenEvent 进行 push 。 上面两个例子只是理论上可以这么做，原作者并没有在实际项目中尝试，这里是为了说明通过响应链做一些有趣的事情。

