单向数据流动的函数式 View Controller 传统 MVC 的问题： 修改 UI 的代码到处散落，随着逻辑变得复杂， UI 的状态将难以追踪； 难以测试； 无法重构。 结合纯函数将其重构为单向流： func reducer(state: State, userAction: Action) -> State 输出结果 State 只受输入 state 和 userAction 影响，在两者相同的情况下，输出 state 永远相同，其原理与 Swift 中的 reduce 函数类似： func reduce<Result>(_ initialResult: Result, _ nextPartialResult: (Result, Element) throws -> Result) rethrows -> Result 在实际使用中，仅仅靠纯函数可能无法满足我们的需求，有时候还希望有“副作用”选项，希望在完成异步操作后可以执行对应的 command ： func reducer(state: State, userAction: Action) -> (State, Command?) 整体的架构图 使用一个 Store 来存储 subscriber 和相关数据： protocol ActionType {}
protocol StateType {}
protocol CommandType {} class Store<A: ActionType, S: StateType, C: CommandType> { let reducer: (_ state: S, _ action: A) -> (S, C?) var subscriber: ((_ state: S, _ previousState: S, _ command: C?) -> Void)? var state: S init(reducer: @escaping (S, A) -> (S, C?), initialState: S) { self.reducer = reducer self.state = initialState } func subscribe(_ handler: @escaping (S, S, C?) -> Void) { self.subscriber = handler } func unsubscribe() { self.subscriber = nil } func dispatch(_ action: A) { let previousState = state let (nextState, command) = reducer(state, action) state = nextState subscriber?(state, previousState, command) }
} ViewController 通过 subscribe 方法来订阅数据源的改动进行 UI 调整， 通过 dispatch 传递 action 。同时也编写了一些单元测试来证明其可测试性。 这里在没有接入三方库的情况实现了单向数据流，如果想要尝试，也可试一下 ReSwift/ReSwift Objective-C 版本在这里： Objective-C单向数据流方案 提供了一个 RFStore 的 Store 基类，内部做了一些 hook 处理，对于 action 开头的 selector 调用，都会调用 listeners 的 block ： + (void)hookActionMethodsIfNeededForClass:(Class)class { static const void * const kHasHookedKey = &kHasHookedKey; @synchronized(class) { id hasHooked = objc_getAssociatedObject(class, kHasHookedKey); if (!hasHooked) { unsigned int outCount = 0; Method *methods = class_copyMethodList(class, &outCount); for (unsigned int i = 0; i < outCount; ++i) { Method method = methods[i]; SEL selector = method_getName(method); NSString *methodName = NSStringFromSelector(selector); if (![methodName hasPrefix:@"action"]) { continue; } [RFStore registerActionForClass:class selector:selector]; } objc_setAssociatedObject(class, kHasHookedKey, @YES, OBJC_ASSOCIATION_RETAIN_NONATOMIC); } }
} + (void)registerActionForClass:(Class)class selector:(SEL)selector { [class rfaspect_hookSelector:selector withOptions:AspectPositionAfter usingBlock:^(id<RFAspectInfo> aspectInfo) { RFAction *action = [[RFAction alloc] initWithObject:aspectInfo.instance selector:selector arguments:aspectInfo.arguments]; NSArray *globalListeners = [objc_getAssociatedObject([RFStore class], kListernersKey) allObjects]; NSArray *listeners = [objc_getAssociatedObject(action.object, kListernersKey) allObjects]; dispatch_async(dispatch_get_main_queue(), ^{ for (RFSubscription *subscription in globalListeners) { subscription.block(action); } for (RFSubscription *subscription in listeners) { subscription.block(action); } }); } error:nil];
} listeners 使用 weak 的 NSPointerArray 进行存储，所以当 ViewController 释放后， RFStore 也会释放掉： + (void)associateObject:(id)object withSubscription:(RFSubscription *)subscription { @synchronized(object) { NSPointerArray *listeners = objc_getAssociatedObject(object, kListernersKey); if (!listeners) { listeners = [NSPointerArray weakObjectsPointerArray]; objc_setAssociatedObject(object, kListernersKey, listeners, OBJC_ASSOCIATION_RETAIN_NONATOMIC); } [listeners compact]; [listeners addPointer:(void *)subscription]; }
} 作者在最后提到对于 Reflow ，更重要的是其架构设计和规范： model 对象不可变； 整个 app 的数据存于 store 层； 更新和通知也收拢于 store 层。

