kickstarter/native-docs 所有 inputs 都是 MutableProperty （ RxSwift 中对应的类型为 BehaviorSubject ）类型，好处是可以直接进行设置，通过 input 的方法进行传递： fileprivate let projectTappedProperty = MutableProperty<Project?>(nil)
public func projectTapped(_ project: Project) { self.projectTappedProperty.value = project
} input 变量使用 Property 作为为后缀，以表示它是一个 MutableProperty 变量，而方法名则表示了所进行的动作。如果 input 值为空，可以通过以下的方式进行设置： fileprivate let viewDidLoadProperty = MutableProperty()
public func viewDidLoad() { self.viewDidLoadProperty.value = ()
} 所有 outputs 都使用 Signal （ RxSwift 中对应的类型为 Observable ）类型，使用 NoError 作为第二个错误参数： public let goToDiscovery: Signal<DiscoveryParams, NoError> 当 Signal 变量没有初始化时， Xcode 会打印相关错误，可以通过设置默认值 .empty 来避免这种情况： public let goToDiscovery: Signal<DiscoveryParams, NoError> = .empty 使用清晰，简洁，明了的命名规则。举个例子，如果 input 是个按钮点击事件，那么使用 buttonTapped 作为 input 方法名。如果 output 是一个显示在弹窗中的错误信息，那么可以使用 showErrorMessageDialog 。变量名应该可以直接得到以下信息： 如何触发输入操作； 输出应该做哪些事情。 尽量减少其它额外信息。

