kickstarter/native-docs // {Alphabetized list of imports}
import Models
import ReactiveCocoa
import Result public protocol ViewModelInputs { // {Alphabetized list of input functions with documentation} /// Call with the project supplied to the view. func configureWith(project project: Project) /// Call when the view loads. func viewDidLoad()
} public protocol ViewModelOutputs { // {Alphabetized list of output signals with documentation} /// Emits the creator's name. var creatorName: Signal<String, NoError> { get }
} public protocol ViewModelType { var inputs: ViewModelInputs { get } var outputs: ViewModelOutputs { get }
} public final class ViewModel: ViewModelType, ViewModelInputs, ViewModelOutputs { // {Constructor of the view model at the top.} public init() { // {Assign all outputs in terms of the inputs.} self.creatorName = self.projectProperty.ignoreNil().map { $0.creator.name } } // {Implementation of interfaces at the bottom of the view model.} // {Alphabetized declaration of all input functions and the `MutableProperty`s that back them.} private let projectProperty = MutableProperty<Project?>(nil) public func configureWith(project project: Project) { self.projectProperty.value = project } private let viewDidLoadProperty = MutableProperty() public func viewDidLoad() { self.viewDidLoadProperty.value = () } // {Alphabetized declaration of all output signals} public let creatorName: Signal<String, NoError> { get } // {Declaration of inputs/outputs} public var inputs: ViewModelInputs { return self } public var outputs: ViewModelOutputs { return self }
} // {Private helper methods (optional) at the bottom of the file.} private func helper() -> String { return "Hello"
} 可以看到将 inputs 和 outputs 拆成了两个协议： ViewModelInputs 和 ViewModelOutputs ， ViewModelInputs 中都是方法，方便 UI 层调用。再使用 ViewModelType 协议对 ViewModelInputs 和 ViewModelOutputs 进行封装，外界不需要知道 ViewModel 的具体类型，只需要知道 ViewModelType 协议即可。即使是访问实例变量，也使用 self 。这些规则可以大大减少沟通成本，所有人写出来的代码在接口层级都是一致的。

