{ static bool loading = NO; bool more_categories; loadMethodLock.assertLocked(); // 加载中，直接返回 if (loading) return; loading = YES; void *pool = objc_autoreleasePoolPush(); do { // 调用类的 +load 方法，直到列表为空 while (loadable_classes_used > 0) { // ➡️ 调用类的 +load 方法 call_class_loads(); } // 调用分类的 +load 方法一次 more_categories = call_category_loads(); // 如果有类或者分类未调用 +load 方法，则尝试再调用一次 } while (loadable_classes_used > 0 || more_categories); objc_autoreleasePoolPop(pool); loading = NO;
} 调用分类 +load 方法时需要确保类已经加载： if (cls && cls->isLoadable()) { (*load_method)(cls, SEL_load); cats[i].cat = nil;
