Domain Layer 负责处理业务逻辑，也包含了 Entities 部分，对应业务中需要处理的 Model ，在 Demo 中就是 Movie 和 MovieQuery 。以 Demo 中的 SearchMoviesUseCase 来简单说明下，其定义了对外提供的能力： protocol SearchMoviesUseCase { func execute(requestValue: SearchMoviesUseCaseRequestValue, cached: @escaping (MoviesPage) -> Void, completion: @escaping (Result<MoviesPage, Error>) -> Void) -> Cancellable?
} 而 Interfaces/Repositories 则定义了数据层应该实现的相关接口： protocol MoviesRepository { @discardableResult func fetchMoviesList(query: MovieQuery, page: Int, cached: @escaping (MoviesPage) -> Void, completion: @escaping (Result<MoviesPage, Error>) -> Void) -> Cancellable?
} protocol MoviesQueriesRepository { func fetchRecentsQueries(maxCount: Int, completion: @escaping (Result<[MovieQuery], Error>) -> Void) func saveRecentQuery(query: MovieQuery, completion: @escaping (Result<MovieQuery, Error>) -> Void)
} 而 DefaultSearchMoviesUseCase 则提供了 SearchMoviesUseCase 的默认实现，初始化参数包括 MoviesRepository 和 MoviesQueriesRepository ，上层可以通过依赖注入实现这两个协议，为 DefaultSearchMoviesUseCase 提供数据层的功能： final class DefaultSearchMoviesUseCase: SearchMoviesUseCase { private let moviesRepository: MoviesRepository private let moviesQueriesRepository: MoviesQueriesRepository init(moviesRepository: MoviesRepository, moviesQueriesRepository: MoviesQueriesRepository) { self.moviesRepository = moviesRepository self.moviesQueriesRepository = moviesQueriesRepository } func execute(requestValue: SearchMoviesUseCaseRequestValue, completion: @escaping (Result<MoviesPage, Error>) -> Void) -> Cancellable? { return moviesRepository.fetchMoviesList(query: requestValue.query, page: requestValue.page) { result in if case .success = result { self.moviesQueriesRepository.saveRecentQuery(query: requestValue.query) { _ in } } completion(result) } }
} 也可以使用通用的 UseCase 协议： public protocol UseCase { @discardableResult func start() -> Cancellable?
} 通用的 UseCase 协议只有一个 start 的方法，会返回一个 cancellable 协议，如果说要使用 UseCase 协议，可以在初始化时设置相关的 closure 回调， start 时进行设置： final class FetchRecentMovieQueriesUseCase: UseCase { struct RequestValue { let maxCount: Int } typealias ResultValue = (Result<[MovieQuery], Error>) private let requestValue: RequestValue private let completion: (ResultValue) -> Void private let moviesQueriesRepository: MoviesQueriesRepository init(requestValue: RequestValue, completion: @escaping (ResultValue) -> Void, moviesQueriesRepository: MoviesQueriesRepository) { self.requestValue = requestValue self.completion = completion self.moviesQueriesRepository = moviesQueriesRepository } func start() -> Cancellable? { moviesQueriesRepository.fetchRecentsQueries(maxCount: requestValue.maxCount, completion: completion) return nil }
}

