Data Layer 分为 Repositories ，Network 和 PersistentStorages 三部分。 Repositories 实现了 Domain Layer 层的 protocol ，其作用是负责串联网络请求数据和本地持久化部分。比如说 DefaultMoviesRepository ，其 fetchMoviesList 的逻辑是先查询缓存是否有对应的数据，如果有，就调用 cached 回调，同时进行网络请求，获取最新的数据： final class DefaultMoviesRepository { private let dataTransferService: DataTransferService private let cache: MoviesResponseStorage init(dataTransferService: DataTransferService, cache: MoviesResponseStorage) { self.dataTransferService = dataTransferService self.cache = cache }
} extension DefaultMoviesRepository: MoviesRepository { public func fetchMoviesList(query: MovieQuery, page: Int, cached: @escaping (MoviesPage) -> Void, completion: @escaping (Result<MoviesPage, Error>) -> Void) -> Cancellable? { let requestDTO = MoviesRequestDTO(query: query.query, page: page) let task = RepositoryTask() cache.getResponse(for: requestDTO) { result in if case let .success(responseDTO?) = result { cached(responseDTO.toDomain()) } guard !task.isCancelled else { return } let endpoint = APIEndpoints.getMovies(with: requestDTO) task.networkTask = self.dataTransferService.request(with: endpoint) { result in switch result { case .success(let responseDTO): self.cache.save(response: responseDTO, for: requestDTO) completion(.success(responseDTO.toDomain())) case .failure(let error): completion(.failure(error)) } } } return task }
} DTO 为 Data Transfer Object 的缩写，表示从 JSON 转换而来的对象。同时也可以将请求的结果进行持久化，比如说从 DTO 转换为 NSManagedObject 。 DataTransferService 和 MoviesResponseStorage 都是协议， Repository 并不关心其具体实现，只需要有提供相关接口即可，比如说数据层可以从 CoreData 迁移到 Realm 。

