ibireme/YYText CADisplayLink 支持以和屏幕刷新率同步的方式更新屏幕上的内容，当注册到 RunLoop 后，每次当屏幕时，都会执行 CADisplayLink 的方法，与 NSTimer 不同的时其内部操作的是一个 Source 。 YYKit 中通过 CADisplayLink 写了个 debug 时显示 FPS的小工具： - (void)tick:(CADisplayLink *)link { if (_lastTime == 0) { _lastTime = link.timestamp; return; } _count++; NSTimeInterval delta = link.timestamp - _lastTime; if (delta < 1) return; _lastTime = link.timestamp; float fps = _count / delta; _count = 0; CGFloat progress = fps / 60.0; UIColor *color = [UIColor colorWithHue:0.27 * (progress - 0.2) saturation:1 brightness:0.9 alpha:1]; NSMutableAttributedString *text = [[NSMutableAttributedString alloc] initWithString:[NSString stringWithFormat:@"%d FPS",(int)round(fps)]]; [text setColor:color range:NSMakeRange(0, text.length - 3)]; [text setColor:[UIColor whiteColor] range:NSMakeRange(text.length - 3, 3)]; text.font = _font; [text setFont:_subFont range:NSMakeRange(text.length - 4, 1)]; self.attributedText = text;
} CADisplayLink 刷新频率跟屏幕刷新一致，刷新频率为 60HZ ，每次刷新时 _count 都会加 1 ，如果 delta < 1 ，则表示没有超过 1s ，直接返回，如果超过 1s 则通过 _count 计算出 fps 。记得 CADisplayLink 需要添加 NSRunLoopCommonModes 。 Swift 版本： class WeakProxy: NSObject { weak var target: NSObjectProtocol? init(target: NSObjectProtocol) { self.target = target super.init() } override func responds(to aSelector: Selector!) -> Bool { return (target?.responds(to: aSelector) ?? false) || super.responds(to: aSelector) } override func forwardingTarget(for aSelector: Selector!) -> Any? { return target }
} class FPSLabel: UILabel { var link:CADisplayLink! //记录方法执行次数 var count: Int = 0 //记录上次方法执行的时间，通过link.timestamp - _lastTime计算时间间隔 var lastTime: TimeInterval = 0 var _font: UIFont! var _subFont: UIFont! fileprivate let defaultSize = CGSize(width: 55,height: 20) override init(frame: CGRect) { super.init(frame: frame) if frame.size.width == 0 && frame.size.height == 0 { self.frame.size = defaultSize } self.layer.cornerRadius = 5 self.clipsToBounds = true self.textAlignment = NSTextAlignment.center self.isUserInteractionEnabled = false self.backgroundColor = UIColor.white.withAlphaComponent(0.7) _font = UIFont(name: "Menlo", size: 14) if _font != nil { _subFont = UIFont(name: "Menlo", size: 4) }else{ _font = UIFont(name: "Courier", size: 14) _subFont = UIFont(name: "Courier", size: 4) } link = CADisplayLink(target: WeakProxy.init(target: self), selector: #selector(FPSLabel.tick(link:))) link.add(to: RunLoop.main, forMode: .commonModes) } //CADisplayLink 刷新执行的方法 @objc func tick(link: CADisplayLink) { guard lastTime != 0 else { lastTime = link.timestamp return } count += 1 let timePassed = link.timestamp - lastTime //时间大于等于1秒计算一次，也就是FPSLabel刷新的间隔，不希望太频繁刷新 guard timePassed >= 1 else { return } lastTime = link.timestamp let fps = Double(count) / timePassed count = 0 let progress = fps / 60.0 let color = UIColor(hue: CGFloat(0.27 * (progress - 0.2)), saturation: 1, brightness: 0.9, alpha: 1) let text = NSMutableAttributedString(string: "\(Int(round(fps))) FPS") text.addAttribute(NSAttributedStringKey.foregroundColor, value: color, range: NSRange(location: 0, length: text.length - 3)) text.addAttribute(NSAttributedStringKey.foregroundColor, value: UIColor.white, range: NSRange(location: text.length - 3, length: 3)) text.addAttribute(NSAttributedStringKey.font, value: _font, range: NSRange(location: 0, length: text.length)) text.addAttribute(NSAttributedStringKey.font, value: _subFont, range: NSRange(location: text.length - 4, length: 1)) self.attributedText = text } // 把displaylin从Runloop modes中移除 deinit { link.invalidate() } required init?(coder aDecoder: NSCoder) { fatalError("init(coder:) has not been implemented") } }

