} static const struct mach_header **copyAllSelfDefinedImageHeader(unsigned int *outCount) { unsigned int imageCount = _dyld_image_count(); unsigned int count = 0; const struct mach_header **mhdrList = NULL; if (imageCount > 0) { mhdrList = (const struct mach_header **)malloc(sizeof(struct mach_header *) * imageCount); for (unsigned int i = 0; i < imageCount; i++) { const char *imageName = _dyld_get_image_name(i); if (isSelfDefinedImage(imageName)) { const struct mach_header *mhdr = _dyld_get_image_header(i); mhdrList[count++] = mhdr; } } mhdrList[count] = NULL; } if (outCount) *outCount = count; return mhdrList;
} 如何获取定义了 +load 的类或者分类，在编译时期，包含 +load 的 class 和 category 会写入 Mach-O 文件 data 段的 __objc_nlcslist 和 __objc_nlcatlist 节，可以通过读取这两部分来获取 no lazy class 和 no lazy category 列表，即定义了 +load 方法的类或者分类 static NSArray <LMLoadInfo *> *getNoLazyArray(const struct mach_header *mhdr) { NSMutableArray *noLazyArray = [NSMutableArray new]; unsigned long bytes = 0; Class *clses = (Class *)getDataSection(mhdr, "__objc_nlclslist", &bytes); for (unsigned int i = 0; i < bytes / sizeof(Class); i++) { LMLoadInfo *info = [[LMLoadInfo alloc] initWithClass:clses[i]]; if (!shouldRejectClass(info.clsname)) [noLazyArray addObject:info]; } bytes = 0; Category *cats = getDataSection(mhdr, "__objc_nlcatlist", &bytes); for (unsigned int i = 0; i < bytes / sizeof(Category); i++) { LMLoadInfo *info = [[LMLoadInfo alloc] initWithCategory:cats[i]]; if (!shouldRejectClass(info.clsname)) [noLazyArray addObject:info]; } return noLazyArray;
} hook +load 方法： static void swizzleLoadMethod(Class cls, Method method, LMLoadInfo *info) {
retry: do { SEL hookSel = getRandomLoadSelector(); Class metaCls = object_getClass(cls); IMP hookImp = imp_implementationWithBlock(^ { info->_start = CFAbsoluteTimeGetCurrent(); ((void (*)(Class, SEL))objc_msgSend)(cls, hookSel); info->_end = CFAbsoluteTimeGetCurrent(); if (!--LMAllLoadNumber) printLoadInfoWappers(); }); BOOL didAddMethod = class_addMethod(metaCls, hookSel, hookImp, method_getTypeEncoding(method)); if (!didAddMethod) goto retry; info->_nSEL = hookSel; Method hookMethod = class_getInstanceMethod(metaCls, hookSel); method_exchangeImplementations(method, hookMethod); } while(0);
} static void hookAllLoadMethods(LMLoadInfoWrapper *infoWrapper) { unsigned int count = 0; Class metaCls = object_getClass(infoWrapper.cls); Method *methodList = class_copyMethodList(metaCls, &count); for (unsigned int i = 0; i < count; i++) { Method method = methodList[i]; SEL sel = method_getName(method); const char *name = sel_getName(sel); if (!strcmp(name, "load")) { IMP imp = method_getImplementation(method); LMLoadInfo *info = [infoWrapper findLoadInfoByImp:imp]; if (!info) { info = [infoWrapper findClassLoadInfo]; if (!info) continue; } swizzleLoadMethod(infoWrapper.cls, method, info); } } free(methodList);
} 相应的实现： tripleCC/Laboratory

