} 函数通过 memmove 将栈中的 Block 的内容拷贝到了堆中，并使 isa 指向了 _NSConcreteMallocBlock 。 Block 的拷贝代码在 _Block_copy_internal 函数中，根据 Block 的类型不同，拷贝过程中的操作也不同。 栈 Block 的拷贝不仅是拷贝了内容，而且由于从栈拷贝到堆中，还会进行一些额外的操作： 往 flags 中并入 BLOCK_NEEDS_FREE ，并将引用计数设置为 1，表示 Block 需要释放，需要自行 release ； 如果有辅助 copy 函数 ( BLOCK_HAS_COPY_DISPOSE )，那么就会调用辅助 copy 函数来拷贝 Block 捕获的变量。 ...
struct Block_layout *result = malloc(aBlock->descriptor->size);
if (!result) return (void *)0;
memmove(result, aBlock, aBlock->descriptor->size); // bitcopy first
// reset refcount
result->flags &= ~(BLOCK_REFCOUNT_MASK); // XXX not needed
result->flags |= BLOCK_NEEDS_FREE | 1;
result->isa = _NSConcreteMallocBlock;
if (result->flags & BLOCK_HAS_COPY_DISPOSE) { //printf("calling block copy helper %p(%p, %p)...\n", aBlock->descriptor->copy, result, aBlock); (*aBlock->descriptor->copy)(result, aBlock); // do fixup
}
return result;
