Obj-C 中的 Block Objective-C 中的 Block 相当于匿名函数。 通过 xcrun -sdk iphoneos clang -arch arm64 -rewrite-objc main.m -o main.cpp 转换为 C++ 代码可以查看 Block 的结构体。 __main_3_block_impl_0 为具体 Block 对应的 struct ，包含 __block_impl 和 __main_3_block_desc_0 。 // Block 实现的结构体
struct __block_impl { void *isa; // isa 指针，即 Block 也是 id 类型，即 Obj-C 对象 int Flags; // 标记，默认会被初始化为 0 int Reserved; // 保留域（ABI 兼容），默认 0 void *FuncPtr; // Block 代码块的函数指针
}; // ➡️ Block 结构体
struct __main_3_block_impl_0 { struct __block_impl impl; // 实现（非指针） struct __main_3_block_desc_0* Desc; // 描述信息（指针） // 构造函数 __main_3_block_impl_0(void *fp, struct __main_3_block_desc_0 *desc, int flags=0) { impl.isa = &_NSConcreteStackBlock; // Block 作为 Obj-C 对象，那么 isa 将指向其类对象，即 _NSConcreteStackBlock impl.Flags = flags; impl.FuncPtr = fp; Desc = desc; }
}; // Block 内代码块封装在该 C 语言静态函数中，函数命名规则：__CALLER_METHOD_NAME_block_func_NUMBER
// 类似 Obj-C 实例方法参数 self 或 C++ 实例方法参数 this，__cself 为指向 Block 结构体的变量
static void __main_3_block_func_0(struct __main_3_block_impl_0 *__cself) { NSLog((NSString *)&__NSConstantStringImpl__var_folders_ps_0m9gnvtj0893vpf1cr595djh0000gn_T_main_b9596e_mi_0);
} // Block 描述信息的结构体静态变量
static struct __main_3_block_desc_0 { size_t reserved; // 保留域，默认 0 size_t Block_size; // Block 大小，sizeof 整个 Block 结构体 ⬇️
} __main_3_block_desc_0_DATA = { 0, sizeof(struct __main_3_block_impl_0)}; // 主函数
int main_3(int argc, const char * argv[]) { // 通过 __main_3_block_impl_0 结构体的构造函数初始化，参数为静态函数和描述信息静态变量的地址，将地址存储在 block 变量中 // 忽略类型转换：block = &__main_3_block_impl_0(__main_3_block_func_0, &__main_3_block_desc_0_DATA)); void(*block)(void) = ((void (*)())&__main_3_block_impl_0((void *)__main_3_block_func_0, &__main_3_block_desc_0_DATA)); // 执行 Block（参数 block 即静态函数中的参数 __cself） // 忽略类型转换：block->FuncPtr(block); // 在 __main_block_impl_0 结构体中，impl 是第一个变量，因此其与结构体本身的首地址一致，因此可以强转 ((void (*)(__block_impl *))((__block_impl *)block)->FuncPtr)((__block_impl *)block); return 0;
} Block 对于捕获变量的不同也会有不同的处理 局部变量，进行值拷贝传递，修改原有的值不影响 Block 所捕获的值； 显式或者隐式捕获 self ，Block 会持有 self 的引用，有可能触发我们常说的循环引用； 静态局部变量， 虽然作用域在代码块内，但是其生命周期是全局的，所以 Block 直接持有对变量的引用； 全局变量，Block 不会捕获，使用时直接进行读取。 Block 的类型： __NSGlobalBlock__ ，不捕获自动变量，即运行时不依赖上下文，放在内存的数据段 (Data Section) ，和全局变量同一个 Section 。对 __NSGlobalBlock__ 执行拷贝后得到的仍是 __NSGlobalBlock__ 。 __NSStackBlock__ ，当 Block 捕获了外界自动变量时，则会被分配在栈区，变成 __NSStackBlock__ ，开发者无需关心其生命周期。 __NSMallocBlock__ ，Block 分配在堆区，需要开发者手动管理其生命周期，ARC 下编译器会根据情况将 __NSStackBlock__ 类型的 Block 自动 copy 到堆上，将 Block 的 isa 设置为 _NSConcreteMallocBlock ，以下操作会将 Block copy 到堆上： 强指针或者属性指向的 Block ； Block 作为函数值会自动拷贝； Block 作为 Cocoa API 中方法名含有 usingBlock 的参数时会自动拷贝； Block 作为 GCD API 参数时会被自动拷贝； __block 声明的变量： Block 内可以直接修改 __block 声明会将变量封装为对应的结构体，而不同的变量就会生成不同的结构体。 __block 变量从声明后，无论在 Block 内外去访问均是通过结构体的 __forwarding 指针即 blockVar.__forwarding->blockVar 。当 __block 变量在栈上时， blockVar.__forwarding->blockVar 就等同于直接通过 blockVar->blockVar 来访问的，因为此时 __forwarding 就指向栈上的结构体本身；而当 Block 拷贝到堆上时， __block 变量也会被拷贝到堆上，此时栈上的 __forwarding 将替换为指向堆上的结构体，而堆上的结构体里的 __forwarding 将指向堆上的结构体本身，从而保证后续的数据变动均是在堆上。 上面说到 Block 会生成不同的结构体，也就说使用 Block 实现的功能代码量会较多。 循环引用： typedef void(^BlockType_5)(void); @interface Foo_9 : NSObject
@property (nonatomic, assign) NSUInteger bar;
@property (nonatomic, copy) BlockType_5 block;
@end @implementation Foo_9
- (void)dealloc
{
#if !__has_feature(objc_arc) [super dealloc];
#endifNSLog(@"dealloc");
} - (void)foo_1 { // Block 捕获了 self，其强引用了 Block，导致双方都无法释放 self.block = ^{ // WARNING: Capturing 'self' strongly in this block is likely to lead to a retain cycle NSLog(@"%lu", (unsigned long)self.bar); // WARNING: Block implicitly retains 'self'; explicitly mention 'self' to indicate this is intended behavior NSLog(@"%lu", (unsigned long)_bar); // self->_bar };
}
@end int main_22(int argc, const char * argv[]) {
#if __has_feature(objc_arc) Foo_9 *f = [[Foo_9 alloc] init]; f.bar = 20; f.block = ^{ // Block 捕获了 f，其强引用了 Block，导致双方都无法释放 // WARNING: Capturing 'f' strongly in this block is likely to lead to a retain cycle NSLog(@"%lu", (unsigned long)f.bar); }; f.block(); [f foo_1]; // Never call dealloc
#endifreturn 0;
} // OUTPUT:
// 20

