用 Block 实现委托方法 使用 NSInvocation ，消息转化机制和 Block 结构体获取 NSMethodSignature 。 NSInvocation 需要注意的地方： 方法的自定义参数从 index 2 开始，前两个参数是接收消息的对象和方法的 SEL ； -getArgument:atIndex: 和 -getReturnvalue: 方法中获取的对象不会进行 retain ，所以不能直接使用具体的对象指针，只能使用 vod * ： // 错误代码
NSString *bar = nil;
[invocation getArgument:&bar atIndex:2]; NSString *result = nil;
[invocation getReturnValue:&result]; // 正确代码
void *bar = nil;
//__unsafe_unretained NSString *bar = nil;
//__weak NSString *bar = nil;
[invocation getArgument:&bar atIndex:2]; void *result = nil;
//__unsafe_unretained NSString *result = nil;
//__weak NSString *result = nil;
[invocation getReturnValue:&result]; 如果是在两个 NSInvocation 对象间传递参数/返回值，可以直接传入指针获取和设置目标地址： ....
NSInvocation *invocation = [NSInvocation invocationWithMethodSignature:signature];
NSInvocation *shadowInvocation = [NSInvocation invocationWithMethodSignature:signature];
....
void *resultBuffer = malloc(invocation.methodSignature.methodReturnLength);
memset(resultBuffer, 0, invocation.methodSignature.methodReturnLength); [invocation getReturnValue:resultBuffer];
[shadowInvocation setReturnValue:resultBuffer];
....
free(resultBuffer); 从协议中获取方法签名，利用 protocol_getMethodDescription 函数，可以获取到描述类型的 C 字符串，再通过这个字符串构造方法签名。针对协议中的接口有 required 和 optional 两种，并且不允许重复这一特点，可以创建构造方法签名的函数： static NSMethodSignature *tbv_getProtocolMethodSignature(Protocol *protocol, SEL selector, BOOL isInstanceMethod) { struct objc_method_description methodDescription = protocol_getMethodDescription(protocol, selector, YES, isInstanceMethod); if (!methodDescription.name) { methodDescription = protocol_getMethodDescription(protocol, selector, NO, isInstanceMethod); } return [NSMethodSignature signatureWithObjCTypes:methodDescription.types];
} 第三个参数表示是否为 required ，如果从 required 中获取不到对应的 objc_method_description ，再从 optional 中获取： Apple Developer Documentation 从 Block 中获取方法签名，虽然苹果没有提供公开的 API 给开发者获取，但是可以通过自定义一个与 Block 结构相同的 struct ，通过这个 struct 来获取方法签名： // Block internals.
typedef NS_OPTIONS(int, TBVBlockFlags) { TBVBlockFlagsHasCopyDisposeHelpers = (1 << 25), TBVBlockFlagsHasSignature = (1 << 30)
};
typedef struct tbv_block { __unused Class isa; TBVBlockFlags flags; __unused int reserved; void (__unused *invoke)(struct tbv_block *block, ...); struct { unsigned long int reserved; unsigned long int size; // requires TBVBlockFlagsHasCopyDisposeHelpers void (*copy)(void *dst, const void *src); void (*dispose)(const void *); // requires TBVBlockFlagsHasSignature const char *signature; const char *layout; } *descriptor; // imported variables
} *TBVBlockRef; // 使用自定义的 TBVBlockRef 获取 descriptor
static NSMethodSignature *tbv_signatureForBlock(id block) { TBVBlockRef layout = (__bridge TBVBlockRef)(block); // 没有签名，直接返回空 if (!(layout->flags & TBVBlockFlagsHasSignature)) { return nil; } // 获取 descriptor 指针 void *desc = layout->descriptor; // 跳过 reserved 和 size 成员 desc += 2 * sizeof(unsigned long int); // 如果有 Helpers 函数， 跳过 copy 和 dispose 成员 if (layout->flags & TBVBlockFlagsHasCopyDisposeHelpers) { desc += 2 * sizeof(void *); } // desc 为 signature 指针的地址，转换下给 objcTypes char *objcTypes = (*(char **)desc); return [NSMethodSignature signatureWithObjCTypes:objcTypes];
} 为了确保 Block 和方法两者的参数是相同的，需要对两者的签名进行匹配，即检验返回值类型和参数类型是否相同： static BOOL tbv_isCompatibleBlockSignature(NSMethodSignature *blockSignature, NSMethodSignature *methodSignature) { NSCParameterAssert(blockSignature); NSCParameterAssert(methodSignature); if ([blockSignature isEqual:methodSignature]) { return YES; } // block 参数个数需要小于 method 的参数个数 (针对 block 调用替换 method 调用) // 两者返回类型需要一致 if (blockSignature.numberOfArguments >= methodSignature.numberOfArguments || blockSignature.methodReturnType[0] != methodSignature.methodReturnType[0]) { return NO; } // 参数类型需要一致 BOOL compatibleSignature = YES; // 自定义参数从第二个开始 for (int idx = 2; idx < blockSignature.numberOfArguments; idx++) { // block 相比 method ，默认参数少了 SEL // method: id(@) SEL(:) .... // block: block(@?) .... const char *methodArgument = [methodSignature getArgumentTypeAtIndex:idx]; const char *blockArgument = [blockSignature getArgumentTypeAtIndex:idx - 1]; if (!methodArgument || !blockArgument || methodArgument[0] != blockArgument[0]) { compatibleSignature = NO; break; } } return compatibleSignature;
} 调用 Block 的 NSInvocation ，由于直接调用的是 delegate 方法，在转发时接收到的是方法对应的 NSInvocation ，所以需要将其的参数和返回值传递给 Block 的 NSInvocation ： - (void)invokeWithMethodInvocation:(NSInvocation *)methodInvocation { NSParameterAssert(methodInvocation); NSAssert([self.methodSignature isEqual:methodInvocation.methodSignature], @"Method invocation's signature is not compatible with block signature"); NSMethodSignature *methodSignature = methodInvocation.methodSignature; NSInvocation *blockInvocation = [NSInvocation invocationWithMethodSignature:self.blockSignature]; void *argumentBuffer = NULL; for (int idx = 2; idx < methodSignature.numberOfArguments; idx++) { // 获取参数类型 const char *type = [methodSignature getArgumentTypeAtIndex:idx]; NSUInteger size = 0; // 获取参数大小 NSGetSizeAndAlignment(type, &size, NULL); // 参数缓存 if (!(argumentBuffer = reallocf(argumentBuffer, size))) { return; } // 把 method 的参数传递给 block [methodInvocation getArgument:argumentBuffer atIndex:idx]; [blockInvocation setArgument:argumentBuffer atIndex:idx - 1]; } // 调用 block [blockInvocation invokeWithTarget:self.block]; // 返回值缓存 if (methodSignature.methodReturnLength && (argumentBuffer = reallocf(argumentBuffer, methodSignature.methodReturnLength))) { // 把 block 的返回值传递给 method [blockInvocation getReturnValue:argumentBuffer]; [methodInvocation setReturnValue:argumentBuffer]; } // 释放缓存 free(argumentBuffer);
} // reallocf 函数是 realloc 函数的增强版，它可以在后者无法申请到堆空间时，释放旧的堆空间：
void *reallocf(void *p, size_t s) { void *tmp = realloc(p, s); if(tmp) return tmp; free(p); return NULL;
} 最后是通过消息转发的 forwardInvocaion: 方法进行转发： - (void)forwardInvocation:(NSInvocation *)invocation { TBVBlockInvocation *blockInvocation = self.selectorInvocationMap[NSStringFromSelector(invocation.selector)]; [blockInvocation invokeWithMethodInvocation:invocation];
} - (NSMethodSignature *)methodSignatureForSelector:(SEL)sel { return self.selectorInvocationMap[NSStringFromSelector(sel)].methodSignature;
} - (BOOL)respondsToSelector:(SEL)aSelector { return !!self.selectorInvocationMap[NSStringFromSelector(aSelector)];
}

