聊聊循环引用的检测 由于 Objective-C 使用引用计数作为内存管理方法，且 Block 会强引用所捕获的对象，所以 Block 经常会造成引用循环。本文讲述了如何通过 Block 的布局，捕获变量排序来获取 Block 强引用的对象。 Block 捕获的对象会统一放在 layout 的 descriptor 后面，即 sr_block_layout 结构体的 imported variables 部分，这种操作可以看作在 sr_block_layout 尾部定义了一个 0 长数组，可以根据实际捕获变量的大小，给捕获区域申请对应的内存空间，只不过这一操作由编译器完成 : struct sr_block_layout { void *isa; int flags; int reserved; void (*invoke)(void *, ...); struct sr_block_descriptor *descriptor; char captured[0];
}; // 标志位不一样，这个结构的实际布局也会有差别，这里简单地放在一起好阅读
struct sr_block_descriptor { unsigned long reserved; // Block_descriptor_1 unsigned long size; // Block_descriptor_1 void (*)(void *dst, void *src); // Block_descriptor_2 BLOCK_HAS_COPY_DISPOSE void (*dispose)(void *); // Block_descriptor_2 const char *signature; // Block_descriptor_3 BLOCK_HAS_SIGNATURE const char *layout; // Block_descriptor_3 contents depend on BLOCK_HAS_EXTENDED_LAYOUT
}; Block 的捕获区域布局有特定的排序规则： llvm-mirror/clang 在对齐字节数 ( alignment ) 不相等时，捕获的实体按照 alignment 降序排序 ( C 结构体比较特殊，即使整体占用空间比指针变量大，也排在对象指针后面)，否则按照以下类型排序： __strong 修饰对象指针变量 __block 修饰对象指针变量 __weak 修饰对象指针变量 其他变量 一个例子： NSObject *o1 = [NSObject new];
__weak NSObject *o2 = o1;
__block NSObject *o3 = o1;
unsigned long long j = 4;
int i = 3;
char c = 'a';
void (^blk)(void) = ^{ i; c; o1; o2; o3; j;
}; 输出： (lldb) x/69bx layout
