// Extended layout encoding. // Values for Block_descriptor_3->layout with BLOCK_HAS_EXTENDED_LAYOUT
// and for Block_byref_3->layout with BLOCK_BYREF_LAYOUT_EXTENDED // If the layout field is less than 0x1000, then it is a compact encoding // of the form 0xXYZ: X strong pointers, then Y byref pointers, // then Z weak pointers. // If the layout field is 0x1000 or greater, it points to a // string of layout bytes. Each byte is of the form 0xPN.
// Operator P is from the list below. Value N is a parameter for the operator. enum { ... BLOCK_LAYOUT_NON_OBJECT_BYTES = 1, // N bytes non-objects BLOCK_LAYOUT_NON_OBJECT_WORDS = 2, // N words non-objects BLOCK_LAYOUT_STRONG = 3, // N words strong pointers BLOCK_LAYOUT_BYREF = 4, // N words byref pointers BLOCK_LAYOUT_WEAK = 5, // N words weak pointers ...
