draveness/analyze facebook/FBRetainCycleDetector FBRetainCycleDetector 也提供了获取 Block 强引用对象的功能，与上面的分析 Block 捕获区域的内存布局方式不同，使用了一种比较取巧的方式。 获取 dispose_helper ， dispose_helper 作为 Block 的辅助函数，在 Block 析构时会调用，然后给强引用对象发送 release 消息，借用这个特性进行处理。 struct BlockDescriptor { unsigned long int reserved; // NULL unsigned long int size; // optional helper functions void (*copy_helper)(void *dst, void *src); // IFF (1<<25) void (*dispose_helper)(void *src); // IFF (1<<25) const char *signature; // IFF (1<<30)
}; 另外一个辅助类就是 FBBlockStrongRelationDetector ， FBBlockStrongRelationDetector 重写了 release 方法和新增了一个 trueRelease 方法： - (oneway void)release
{ _strong = YES;
