} void objc_autoreleasePoolPop(void *ctxt) { AutoreleasePoolPage::pop(ctxt);
} AutoreleasePage 的定义如下： class AutoreleasePoolPage { magic_t const magic; id *next; pthread_t const thread; AutoreleasePoolPage * const parent; AutoreleasePoolPage *child; uint32_t const depth; uint32_t hiwat;
}; 自动释放池是由一系列的 AutoreleasePoolPage 组成，每个 AutoreleasePoolPage 的大小都是 4096 bit 大小。 自动释放池是由 AutoreleasePoolPage 以双向链表的方式实现的 当对象调用 autorelease 方法时，会将对象加入 AutoreleasePoolPage 的栈中 调用 AutoreleasePoolPage::pop 方法会向栈中的对象发送 release 消息 当使用容器的 block 枚举时，内部会自动添加一个 AutoreleasePool ： [array enumerateObjectsUsingBlock:^(id obj, NSUInteger idx, BOOL *stop) { // 这里被一个局部@autoreleasepool包围着
