Objective-C 引用计数原理 引用计数如何存储： 如果是 Tagged Pointer ，会直接使用其指针值作为引用计数返回； 如果是 64位和 Objective-C 2.0 ，就会使用 isa 的部分空间来存储引用计数； 如果 isa 部分空间不够存储引用计数，或者不是 64位和 Objective-C 2.0 ，就会使用散列表和 SideTable 来存储。 isa 指针中变量对应的含义 获取引用计数： inline uintptr_t objc_object::rootRetainCount()
{ assert(!UseGC); // 1. 如果是 Tagged Pointer ，则直接返回指针地址 if (isTaggedPointer()) return (uintptr_t)this; sidetable_lock(); isa_t bits = LoadExclusive(&isa.bits); if (bits.indexed) { // 2. 如果有经过优化，则 1 + bits.extra_rc ； uintptr_t rc = 1 + bits.extra_rc; // 3. 如果有使用 SideTable ，则加上 SideTable 的计数； if (bits.has_sidetable_rc) { rc += sidetable_getExtraRC_nolock(); } sidetable_unlock(); return rc; } sidetable_unlock(); return sidetable_retainCount();
} 而 sidetable_retainCount() 则负责从 SideTable 中获取引用计数： uintptr_t
objc_object::sidetable_retainCount()
{ // 1. 根据指针地址获取对应的 SideTable SideTable *table = SideTable::tableForPointer(this); size_t refcnt_result = 1; spinlock_lock(&table->slock); // 2. 获取对象对应的 RefcountMap ； RefcountMap::iterator it = table->refcnts.find(this); if (it != table->refcnts.end()) { // 右移二位， SIDE_TABLE_RC_PINNED 可用于判断是否溢出。 refcnt_result += it->second >> SIDE_TABLE_RC_SHIFT; } spinlock_unlock(&table->slock); return refcnt_result;
} 如官方文档所说的，不要使用 retainCount 方法，它不能真实表达对象所对应的引用计数，以及 Clang 一些优化也会对其造成影响。 Apple Developer Documentation 修改引用计数： retain 和 release ； alloc ， new ， copy 和 mutableCopy ； autorelease 。
